import "./App.css";

function App() {
   const [data, setData] = useState({});

   useEffect(() => {
      fetch("https://jsonplaceholder.typicode.com/todos/1")
         .then((response) => response.json())
         .then((jsonData) => setData(jsonData.stringify()));
   }, []);
